import React, {FC} from 'react';
import { card } from "../../pages/styles/PostStyles";

interface Props {
    children?: any;
}

export const Card: FC<Props> = ({ children }) => {
    return (
        <card.Item>
            <card.ItemWrapper>
                { children }
            </card.ItemWrapper>
        </card.Item>
    );
}
